"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?7/5/7252/abstract/3\">",
"      Shahian DM, O'Brien SM, Filardo G, et al. The Society of Thoracic Surgeons 2008 cardiac surgery risk models: part 1--coronary artery bypass grafting surgery. Ann Thorac Surg 2009; 88:S2.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?7/5/7252/abstract/4\">",
"      Nashef SA, Roques F, Michel P, et al. European system for cardiac operative risk evaluation (EuroSCORE). Eur J Cardiothorac Surg 1999; 16:9.",
"     </a>",
