var title_f7_5_7258="Histology case 2 with answer";
var content_f7_5_7258=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F63777&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F63777&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 540px\">",
"   <div class=\"ttl\">",
"    Histology case 2 with answer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 520px; height: 435px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The correct answer is",
"    <strong>",
"     fibrillary glomerulonephritis",
"    </strong>",
"    . This disorder is characterized by the deposition of fibrillary deposits which result in mesangial expansion with amorphous material (panel A) (suggestive of amyloidosis or light chain deposition disease) and a coarse linear pattern of IgG deposition on immunofluorescence microscopy (panel B). The pathognomonic change is seen on electron microscopy, which shows random fibrillar deposits in the mesangium and glomerular capillary wall that are largely than those seen in amyloidosis (panel C). The micrograph in panel D reveals intramembranous and subendothelial fibrillary deposits (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
